import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter elements to be available
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    const minPriceInput = page.locator('.price-input[placeholder="Min"]');
    const maxPriceInput = page.locator('.price-input[placeholder="Max"]');
    const applyButton = page.locator('button.apply-filter');

    // Fill in the price range
    await minPriceInput.fill('50');
    await maxPriceInput.fill('200');

    // Take a screenshot after entering the price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_entered.png'));

    // Click the apply button
    await applyButton.click();

    // Take a final screenshot after applying the filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract the entered values for verification
    const extractedMinPrice = await minPriceInput.inputValue();
    const extractedMaxPrice = await maxPriceInput.inputValue();

    return {
      success: true,
      action: "Applied price range filter from 50 to 200.",
      extractedData: {
        minPrice: extractedMinPrice,
        maxPrice: extractedMaxPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
